import Block from './Block'

const BlockSet =() => {
    return(
        <div className="absolute top-[20%] w-full h-[75%] bg-sharkGray">
            <Block top={10} left={"1/3"} z={0}/>
            <Block top={15} left={1/2} z={10}/>
            <Block top={20} left={1/2} z={10}/>
            {/* <Block top={25} left={25} z={30}/> */}
            {/* <Block top={30} left={30} z={40}/> */}
        </div>
    )
}

export default BlockSet;
